CSS `@supports` - это правило CSS, которое позволяет вам проверить поддержку определенных CSS-свойств и значений в браузере перед применением определенных стилей. Это очень полезно для создания адаптивных и кросс-браузерных стилей.

Синтаксис `@supports` выглядит следующим образом:
```css
@supports (условие) {
 /* Стили, которые будут применены, если условие истинно */
}
```

